export default function Home() {
  return (
    <div className="text-center mt-20">
      <h1 className="text-4xl font-bold mb-6">Добро пожаловать в ItUpHub!</h1>
      <p className="text-lg text-gray-700">
        Платформа для поиска команд и проектов.
      </p>
    </div>
  );
}
